export function IconCaret (props: IconProps): JSX.Element {
  const direction = props.direction ?? "up"

  function getDirectionsStyle (direction: string): string {
    let style

    switch (direction) {
      case "up":
        style = ""
        break
      case "right":
        style = "rotate-90"
        break
      case "down":
        style = "rotate-180"
        break
      case "left":
        style = "-rotate-90"
        break
      default:
        style = ""
    }
    return style
  }

  const directionStyle = getDirectionsStyle(direction)

  return (
    <Icon
      {...props}
      title={`caret-${direction}`}
      strokeWidth="0"
      width="8"
      height="8"
      viewBox="0 0 8 8"
      className={`${directionStyle}`}
    >
      <g clipPath="url(#clip0_124_100)">
        <path
          d="M0.285706 5.8L3.79999 2.28571C3.82564 2.25838 3.85662 2.23659 3.89102 2.2217C3.92542 2.20681 3.96251 2.19913 3.99999 2.19913C4.03748 2.19913 4.07456 2.20681 4.10896 2.2217C4.14336 2.23659 4.17434 2.25838 4.19999 2.28571L7.71428 5.8"
          stroke="black"
          strokeWidth="1.71429"
          strokeLinecap="round"
          strokeLinejoin="round"
        />
      </g>
      <defs>
        <clipPath id="clip0_124_100">
          <rect width="8" height="8" fill="white" />
        </clipPath>
      </defs>
    </Icon>
  )
}

